import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import { gsap } from 'gsap';

export default function Building3DAnimation() {
  const [progress, setProgress] = useState(10);

  useEffect(() => {
    const timer = setInterval(() => {
      setProgress((prevProgress) => (prevProgress >= 100 ? 10 : prevProgress + 10));
    }, 500);
    return () => {
      clearInterval(timer);
    };
  }, []);

  useEffect(() => {
    const building = document.getElementById('building');

    // GSAP animation to rotate the building
    gsap.to(building, {
      rotationY: '+=360',
      duration: 5,
      repeat: -1,
      ease: 'linear',
    });
  }, []);

  return (
    <Box>
      <div className="anime">
        <div className="load">
          {/* 3D Building Animation */}
          <div id="building" style={{ width: '200px', height: '200px', backgroundColor: 'gray' }}>
            {/* You can add your 3D building model or animation here */}
            {/* For example, a rotating cube or a more complex 3D model */}
            Building
          </div>
        </div>
      </div>
    </Box>
  );
}
